class Solution {
public:
    vector<string> findRelativeRanks(vector<int>& score) {
        int n = score.size();
        vector<pair<int, int>> arr;
        for (int i=0; i<n; i++) arr.push_back({score[i], i});
        sort(rbegin(arr), rend(arr));
        vector<string> res(n);

        for (int i=0; i<n; i++) 
            if(i==0) res[arr[i].second] = "Gold Medal";
            else if(i==1) res[arr[i].second] = "Silver Medal";
            else if(i==2) res[arr[i].second] = "Bronze Medal";
            else res[arr[i].second] = to_string(i+1);

        return res;
    }
};
```
The above code uses the concept of counting sort and string conversions to solve the problem. The sort function is used to arrange the athletes in decreasing order of their scores. Then, based on their rank, the corresponding string is placed in the result array.

Note: This solution assumes that the highest score is the first place, the second highest is the second place and so on. If the highest score is supposed to be the last place, the rank strings should be swapped in the if-else statements.
